import React, { useEffect, useState } from 'react';
import { View, Text } from 'react-native';
import { RectButton, ScrollView, TextInput } from 'react-native-gesture-handler';
import { FontAwesome } from '@expo/vector-icons';
import { useRoute } from '@react-navigation/native';

import styles from './estilo';

import { HeaderRequisicao, DadosUsuario } from '../../AuthContext';

function tConfiguracao() {

    const [nome, setnome] = useState(route.params?.nome);
    const [sobrenome, setsobrenome] = useState(route.params?.sobrenome);
    const [data_de_nasc, setdata_de_nasc] = useState(route.params?.data_de_nasc);
    const [cpf, setcpf] = useState(route.params?.cpf || '');
    const [sexo, setsexo] = useState(route.params?.sexo || '');
    const [celular, setcelular] = useState(route.params?.celular || '');
    const [email, setemail] = useState(route.params?.email || '');
    const [senha, setsenha] = useState(route.params?.senha || '');

    const [cep, setCep] = useState("")
    const [logradouro, setLogradouro] = useState("")
    const [localidade, setLocalidade] = useState("")
    const [uf, setUf] = useState("")
    const [bairro, setBairro] = useState('');

    const Estado = [
        { label: 'Acre', value: 'AC' },
        { label: 'Alagoas', value: 'AL' },
        { label: 'Amapá', value: 'AP' },
        { label: 'Amazonas', value: 'AM' },
        { label: 'Bahia', value: 'BA' },
        { label: 'Ceará', value: 'CE' },
        { label: 'Distrito Federal', value: 'DF' },
        { label: 'Espírito Santo', value: 'ES' },
        { label: 'Goiás', value: 'GO' },
        { label: 'Maranhão', value: 'MA' },
        { label: 'Mato Grosso', value: 'MT' },
        { label: 'Mato Grosso do Sul', value: 'MS' },
        { label: 'Minas Gerais', value: 'MG' },
        { label: 'Pará', value: 'PA' },
        { label: 'Paraíba', value: 'PB' },
        { label: 'Paraná', value: 'PR' },
        { label: 'Pernambuco', value: 'PE' },
        { label: 'Piauí', value: 'PI' },
        { label: 'Rio de Janeiro', value: 'RJ' },
        { label: 'Rio Grande do Norte', value: 'RN' },
        { label: 'Rio Grande do Sul', value: 'RS' },
        { label: 'Rondônia', value: 'RO' },
        { label: 'Roraima', value: 'RR' },
        { label: 'Santa Catarina', value: 'SC' },
        { label: 'São Paulo', value: 'SP' },
        { label: 'Sergipe', value: 'SE' },
        { label: 'Tocantins', value: 'TO' },
    ];

    async function MostrarUsuario() {
        const userData = await DadosUsuario();
        const headers = await HeaderRequisicao();
        const url = `https://localhost:44396/api/usuarios?usuario_id=${userData.ID}`;

        fetch(url, {
            method: 'GET',
            headers
        })
            .then((response) => response.json())
            .then((usuario) => {
                setnome(usuario.nome)
                setBairro(usuario.bairro)
                setBairro(usuario.bairro)
            })
            .catch((error) => {
                console.log(error);
                alert('Erro ao inserir informações');
            });
    }

    useEffect(() => {
        MostrarUsuario();
    }, []);

    return (

        <ScrollView>
            <View style={styles.container}>
                <Text style={styles.title}>Olá, Usuário!</Text>
                <View style={styles.view}>
                    <View style={styles.editor}>
                        <FontAwesome name="pencil-square-o" size={24} color="black" />
                    </View>
                    <Text style={styles.text}>Nome</Text>
                    <TextInput style={styles.input}></TextInput>

                    <TextInput />

                    <Text style={styles.text}>Sobrenome</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <TextInput />

                    <Text style={styles.text}>Email</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <TextInput />

                    <Text style={styles.text}>Cidade</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <TextInput />

                    <Text style={styles.text}>Celular</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <TextInput />

                    <Text style={styles.text}>Preço</Text>
                    <TextInput
                        style={styles.input}
                    />

                    <TextInput />

                    <Text style={styles.text}>Descrição</Text>
                    <TextInput
                        style={styles.inputDesc}
                        multiline
                    />

                    <TextInput />
                    <TextInput />
                    <TextInput />
                    <TextInput />

                    <RectButton style={styles.button}>
                        <Text style={styles.buttonText}>Salvar Alterações</Text>
                    </RectButton>

                    <TextInput />
                    <TextInput />
                    <TextInput />
                    <TextInput />
                </View>
            </View >
        </ScrollView>

    );
}

export default tConfiguracao;
